var slider = document.getElementById('slider');

var rect12 = document.getElementById('rect4596');
var maxHeight = 250;
slider.addEventListener('input', function () {
  var originalHeight = 127; // Set the original height of the rectangle here
  var sliderValue = parseFloat(slider.value);
  var minValue = parseFloat(slider.min);
  var maxValue = parseFloat(slider.max);

  // Reverse the slider value
  var reversedValue = maxValue - (sliderValue - minValue);






  var newY = 253.479 - ((originalHeight * reversedValue) / 100);
if (newY > maxHeight) {
    newY = maxHeight;
  }

  rect12.setAttribute('height', newY);
  rect12.setAttribute('y', originalHeight + originalHeight - newY);
  console.log('Slider value:', reversedValue);

},  

 false);

