const sliderElement = document.getElementById('mySlider');
 let sliderValue = 100;
 let intervalTime = 100; // Set the initial interval time (in milliseconds)

 setInterval(() => {
   // Decrease the slider value
   sliderValue = (sliderValue - 1 + 100) % 101;

   // Update the slider value
   sliderElement.value = sliderValue;

   // Trigger an input event to notify any listeners of the value change
   const event = new Event('input', { bubbles: true });
   sliderElement.dispatchEvent(event);
 }, intervalTime);

 // Function to change the interval time
 function changeIntervalTime(newTime) {
   intervalTime = newTime;
   clearInterval();
   setInterval(updateSlider, intervalTime);
 }

